import React from 'react';

import './sidenav.css';

export const SideNav = (props) =>{
    return (
        <div className="sidenav">
            <img 
            src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fmedia-exp1.licdn.com%2Fdms%2Fimage%2FC5103AQF1nv_H-SKXDQ%2Fprofile-displayphoto-shrink_200_200%2F0%3Fe%3D1584576000%26v%3Dbeta%26t%3DuD4UqqC5Zdv4GADactm-o_gK8AfklWHGBIEU-cgz-Ts&imgrefurl=https%3A%2F%2Fin.linkedin.com%2Fin%2Fpremkothawle&tbnid=em1NaRPkFSkwyM&vet=12ahUKEwim7quLhszpAhWoK7cAHTeOBD8QMygAegUIARDLAQ..i&docid=SoVOC7ftGp2o_M&w=200&h=200&q=prem%20kothawle&safe=strict&ved=2ahUKEwim7quLhszpAhWoK7cAHTeOBD8QMygAegUIARDLAQ"
            className="avatar"
            alt="avatar"/>
        </div>
    )
}
